import React from 'react'

function Home() {
    const clickHandler = (e)=>{
        e.preventDefault()
    }
    return (
        <React.Fragment>
            <form>
                <input type="text" name="row" id="row_num" placeholder='Enter The Number Of Rows' min={3} max={10}/>
                <button type='submit' onClick={clickHandler}>Get Sets</button>
            </form>
        </React.Fragment>
    )
}

export default Home
